def solve(log_data):
    values = {
        '200': 0,
        'not_200': 0,
        'not_int': 0,
        'no_status': 0,
        'err': 0
    }
    for string in log_data:
        try:
            message = json.loads(string)
        except (json.JSONDecodeError, KeyError):
            values['err'] += 1
        else:
            if not message.get('status', 0):
                values['no_status'] += 1
                continue
            try:
                if int(message['status']) == 200:
                    values['200'] += 1
                else:
                    values['not_200'] += 1
            except ValueError:
                values['not_int'] += 1
    return tuple(values.values())

